import './App.css';
import SignIn from './components/SignIn';
import Menu from './components/Menu';
import {
  BrowserRouter, 
  Route,
  Switch,
} from 'react-router-dom'

function App() {
  return (
    <BrowserRouter>
      <div className='App'>
        <Switch>
          <Route exact path="/">
            <SignIn></SignIn>
          </Route> 
          <Route exact path="/menu">
            <Menu></Menu>
          </Route>
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
